import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h4>Home</h4>
      <h6>Welcome my friend, you end up here</h6>
      <a href="/contact"> <button className="btn btn-rounded"> Contact </button> </a>
      <a href="/info"> <button className="btn btn-rounded"> Info </button> </a>
    </div>
  );
}

export default App;
